class DataPumpTest(SeecrTestCase):

    def testSpeed(self):
        class MyObserver(object):
            def add(self, **kwargs):
                return
                yield
        myObserver = MyObserver()
        root = be((Observable(),
            (ZipInbound(fromKwarg="data"),
                (Base64EncodeInbound(fromKwarg="data"),
                    (Base64DecodeInbound(fromKwarg="data"),
                        (UnzipInbound(fromKwarg="data"),
                            (myObserver,)
                        )
                    )
                )
            )
        ))
        result = []
        def add(jsonDict, **kwargs):
            result.append(jsonDict)
            return
            yield
        myObserver.add = add
        list(compose(root.all.add(identifier='identifier', partname='part', jsonDict=str(HUGE))))
        self.assertEqual([str(HUGE)], result)

    def testOutbound(self):
        realData = str(HUGE)
        observer = CallTrace('observer')
        observer.methods['getStream'] = lambda **kwrgs: StringIO(realData)

        root = be((Observable(),
            (UnzipOutbound(),
                (Base64DecodeOutbound(),
                    (Base64EncodeOutbound(),
                        (ZipOutbound(),
                            (observer,)
                        )
                    )
                )
            )
        ))

        result = ''.join(compose(root.all.yieldRecord(identifier='identifier', partname='part')))
        self.assertEqual(realData, result)

    def testSize(self):
        realData = str(HUGE)
        data = [realData[i:i+4096] for i in range(0, len(realData), 4096)]
        observer = CallTrace('observer')
        observer.methods['getStream'] = lambda **kwargs: StringIO(str(HUGE))
        def yieldRecord(**kwargs):
            for d in data:
                yield d
        observer.methods['yieldRecord'] = yieldRecord
        outbound = ZipOutbound()
        outbound.addObserver(observer)
        yieldResult = ''.join(compose(outbound.yieldRecord(identifier='identifier', partname='part')))
        streamResult = outbound.getStream(identifier='identifier', partname='part').read()
        self.assertEqual(len(yieldResult), len(streamResult))

    def testHugeXml(self):
        xml = StringIO()
        xml.write('<root>')
        for k,values in list(HUGE.items()):
            for v in values:
                xml.write('<field name="%s">%s</field>' % (xmlEscape(k), xmlEscape(v)))
        xml.write('</root>')
        xml.seek(0)
        parse(xml)
        observer = CallTrace('observer')
        observer.methods['getStream'] = lambda **kwargs: StringIO(xml.getvalue())

        root = be((Observable(),
            (UnzipOutbound(),
                (Base64DecodeOutbound(),
                    (Base64EncodeOutbound(),
                        (ZipOutbound(),
                            (observer,)
                        )
                    )
                )
            )
        ))

        result = parse(root.call.getStream(identifier='identifier', partname='part'))


def unicodeValues(aFieldsDict):
    newDict = {}
    for k, values in list(aFieldsDict.items()):
        newDict[k] = [str(v) for v in values]
    return newDict

